import { countries } from "./data";
const css = {
  fontSize: "1.2rem",
  fontWeight: "bold",
  lineHeight: "1.5rem",
  color: "white",
  padding: "1rem",
  margin: "1rem",
  border: "1px solid white",
  borderRadius: "1rem",
  boxShadow: "0 0 1rem 0 rgba(0, 0, 0, 0.2)",
  cursor: "pointer",
  backgroundColor: "transparent",
  transition: "all 0.3s ease-in-out",
  "&:hover": {
    backgroundColor: "rgba(0, 0, 0, 0.2)",
    color: "white",
  },
}
// import your component here  and use it in the App.js file or wherever you want to display this data, like so: <Country />
function Country() {
  console.log(countries);
  return (
    <>
      <h1 className={css}>
        {countries.map(country => <p>
          {country.name}
          <ul>
            {country.cities.map(city => <li>{city.name}</li>)}
          </ul>
        </p>)}
      </h1>
    </>
  );
}

export default Country;
